  /*
    中心局原理定理により、N(μ,σ^2/n)に近似
  */

  const ave = 5.5
 const sigma2 = 8.25
  function cdf(x:number, dice:number) {
    if( x <= 0) return 10000
    if( table[dice]?.[x] >= 0 ) return table[dice][x]
    
    const mean = ave * dice
    const sigma = (2.872 * Math.sqrt(dice))
    const to = x;
    console.log(x,dice,mean,sigma,to, (1 - normalcdf(mean, sigma, to)) * 10000);
    return (1 - normalcdf(mean, sigma, to))* 10000

    
}
// https://stackoverflow.com/questions/5259421/cumulative-distribution-function-in-javascript
function normalcdf(mean: number, sigma:number, to:number) 
{
    var z = (to-mean)/Math.sqrt(2*sigma*sigma);
    var t = 1/(1+0.3275911*Math.abs(z));
    var a1 =  0.254829592;
    var a2 = -0.284496736;
    var a3 =  1.421413741;
    var a4 = -1.453152027;
    var a5 =  1.061405429;
    var erf = 1-(((((a5*t + a4)*t) + a3)*t + a2)*t + a1)*t*Math.exp(-z*z);
    var sign = 1;
    if(z < 0)
    {
        sign = -1;
    }
    return (1/2)*(1+sign*erf);
}



  $: p5 = cdf( encroachment - fix - 30, loise + dice)
